def closest_point(point, img):
    mini = 1000
    for p in img:
        dist = (point[0] - p[0]) ** 2 + (point[1] - p[1]) ** 2
        if dist < mini:
            mini = dist
    return mini
    
def subset_points(img1, img2):
    indices = linspace(0, len(img1) - 1, 25)
    summation = 0
    for index in indices:
        index = int(index)
        summation += closest_point(img1[index], img2)
    img2 = map(lambda x : (200 - x[0], 150 - x[1]), img2)
    new_sum = 0
    for index in indices:
        index = int(index)
        new_sum += closest_point(img1[index], img2)
    return min(new_sum, summation)

def resize_contour(cont):
    c = map(lambda x:list(x[0]), cont)
    cfirst = map(lambda x:x[0], c)
    csecond = map(lambda x:x[1],c)
    cm = min(cfirst)
    cm2 = min(csecond)
    csecondmax = 150./(max(csecond) - cm2)
    cfirstmax = 200./(max(cfirst) - cm)
    
    c = map(lambda x : (round((x[0] - cm) * cfirstmax,1), round((x[1]- cm2) * csecondmax,1)), c)
    return c

